import { useEffect } from 'react';
import { useState } from 'react';
import './App.css';
import TopBarComponent from './Components/TopBarComponent';
import { requestAccessToken, spotifyAlbumSearch } from './Functions/SpotifyCalls';
import { verifyAccessToken } from './Helper/SpotifyHelper';
import { checkTheme } from './Helper/ThemeHelper';

function App() {
  const [accessToken,setAccessToken] = useState("");
  const [theme,setTheme] = useState({});

  useEffect(() => {
    setAccessToken(verifyAccessToken())
    setTheme(checkTheme());
  },[])

  return (
    <div className="App">
      <TopBarComponent theme = {theme} setTheme = {setTheme}/>
      Hello World
      Say hello to {accessToken}
    </div>
  );
}

export default App;
